import { Component, TemplateRef, ViewChild } from '@angular/core';
import { Validators, FormGroup, FormBuilder } from '@angular/forms';
import { appRoutes } from 'src/app/library/utility/app-routes';
import { FormErrorHandlerService } from 'src/app/library/components/services/form-error-handler.service';
import { AccountService } from 'src/app/services/account.service';
import { BasePageComponent } from 'src/app/library/components/base-page/base-page.component';
import { HttpErrorResponse } from '@angular/common/http';
import { MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-signin',
  templateUrl: './signin.component.html',
  styleUrls: ['./signin.component.scss'],
})
export class SigninComponent extends BasePageComponent {
  @ViewChild('header') header: TemplateRef<any>;
  @ViewChild('content') content: TemplateRef<any>;
  @ViewChild('actions') actions: TemplateRef<any>;

  form: FormGroup;
  error: any;
  redirectPath = '';

  providers: any[] = [
    {
      name: 'facebook',
      src: 'data:image/png;base64,',
      alt: 'F',
    },
    {
      name: 'google',
      src: 'data:image/jpeg;base64,',
      alt: 'G',
    },
  ];
  constructor(
    private fb: FormBuilder,
    public eh: FormErrorHandlerService,
    private accountService: AccountService,
    private dialogRef: MatDialogRef<any>
  ) {
    super();
  }
  override ngOnInit() {
    this.route.queryParams.subscribe({
      next: (queryParams: any) => {
        this.redirectPath = queryParams.path;
      },
    });

    this.form = this.fb.group({
      email: ['test1@gmail.com', [Validators.email, Validators.required]],
      password: ['Test123!@#', [Validators.required, Validators.minLength(3)]],
      stay: [false],
    });
  }

  onForgotPassword() {
    this.router.navigateByUrl(appRoutes.forgotPassword);
  }

  onApply() {
    const ref = this.dialogService.openYesNoModal(
      'Confirmation',
      'Are you sure'
    );
    ref.afterClosed().subscribe({
      next: (action: string) => {
        if (action == 'yes') {
          this.dialogRef?.close('apply');
        }
      },
    });
  }

  gotoDefaultPage() {
    this.router.navigate([appRoutes.editor]);
  }
  onLogin() {
    this.loadingService.open();
    const { value } = this.form;
    this.error = '';
    this.sbr.add(
      this.accountService.signin(value.email, value.password).subscribe({
        next: (response: any) => {
          this.loadingService.close();
          // this.accountService.test().subscribe({
          //   next: (res: any) => {
          //     console.log(res);
          //   },
          //   error: (error: HttpErrorResponse) => {
          //     this.error = error;
          //   },
          // });

          if (this.dialogRef && this.dialogRef.id) {
            this.dialogRef?.close();
            this.dialogRef.afterClosed().subscribe({
              next: () => {
                this.gotoDefaultPage();
              },
            });
          } else {
            if (this.redirectPath) {
              const queryParams: any = {};
              const parts = this.redirectPath.split('?');
              if (parts.length > 1) {
                const params = parts[1].split('&');
                for (const param of params) {
                  const qp = param.split('=');
                  queryParams[qp[0]] = qp[1];
                }
              }
              this.router.navigate([parts[0]], {
                queryParams,
              });
            } else {
              this.gotoDefaultPage();
            }
          }
        },
        error: (error: HttpErrorResponse) => {
          console.log(error);
          this.error = error.error.message; // .error.error;
          this.loadingService.close();
          this.handleError(error);
        },
      })
    );
  }

  a() {
    this.dialogRef = this.dialogService.openComponentWithTemplates(
      this.header,
      this.content,
      this.actions,
      {
        minHeight: '150px',
        width: '400px',
        hasCloseButton: true,
      }
    );
    this.dialogRef.afterClosed().subscribe({
      next: (result: any) => {
        console.log(result);
      },
    });
    return;
  }

  onSocial(provider: string) {
    console.log(provider);
  }
}
